import { StyleSheet, Text, View } from 'react-native'
import React from 'react'
import { ScrollView } from 'react-native-web'

const Category = () => {
  return (
    <ScrollView>
      <Image />
    </ScrollView>
  )
}

export default Category

const styles = StyleSheet.create({})
